CREATE TABLE time
(
   Date           DATE NOT NULL,
   MonthYear      VARCHAR(20),
   QuarterYear    VARCHAR(20),
   Year           INT NULL,
   MonthNum       INT NULL,
   QuarterNum     INT NULL,
   WeekDay        VARCHAR(20),
   WeekDayNum     INT NULL,
   PRIMARY KEY(Date)
);

CREATE TABLE sectors
(
   IDsector    INT NOT NULL,
   Sector      VARCHAR(255),
   ZipCode     VARCHAR(5) NOT NULL,
   PRIMARY KEY (IDsector)
);

CREATE TABLE products
(
   IDproduct     INT NOT NULL,
   Product       VARCHAR(255),
   IDprodline    INT NULL,
   DietFlag      INT NOT NULL DEFAULT 0,
   PRIMARY KEY (IDproduct)
);

CREATE TABLE product_lines
(
   IDprodline     INT NOT NULL,
   ProductLine    VARCHAR(255),
   IDprodfam      INT NULL,
   PRIMARY KEY (IDprodline) 
);

CREATE TABLE product_families
(
   IDprodfam        INT NOT NULL,
   ProductFamily    VARCHAR(255),
   PRIMARY KEY (IDprodfam)
);

CREATE TABLE orders
(
   IDorder         INT NOT NULL DEFAULT 0,
   IDcusto         INT NULL,
   OrderDate       DATE NULL,
   DeliveryDate    DATE NULL,
   Address          VARCHAR(255),
   ZipCode         VARCHAR(5),
   Parcels         INT NULL,
   IDslot          INT NULL,
   City            VARCHAR(255),
   IDhousehold     INT NULL,
   IDfidelity      INT NULL,
   IDsector        INT NULL,
   PRIMARY KEY (IDorder)
);

CREATE TABLE households
(
   IDhouseh            INT NOT NULL DEFAULT 0,
   Household           VARCHAR(255),
   HouseholdStatus     VARCHAR(20),
   ChildrenCategory    INT NULL,
   PRIMARY KEY(IDhouseh)
);

CREATE TABLE fidelities
(
   IDfidelity    INT NOT NULL,
   Fidelity      VARCHAR(255),
   Mini          INT NULL,
   Maxi          INT NULL,
   PRIMARY KEY (IDfidelity) 
);


CREATE TABLE dwh_facts
(
   IDorder      INT NULL,
   IDproduct    INT NULL,
   Sales        FLOAT(8) NULL,
   Quantity     INT NULL,
   PRIMARY KEY (IDorder, IDproduct)
);

CREATE TABLE dm1_facts
(
   IDfidelity     INT NOT NULL,
   IDhousehold    INT NOT NULL,
   IDproduct      INT NOT NULL,
   IDsector       INT NOT NULL,
   IDslot         INT NOT NULL,
   Date           DATE NOT NULL,
   Sales          FLOAT(8) NULL,
   PRIMARY KEY
      (IDfidelity,
       IDhousehold,
       IDproduct,
       IDsector,
       IDslot,
       Date)
);

CREATE TABLE deliv_slots
(
   IDslot    INT NOT NULL DEFAULT 0,
   Slot      VARCHAR(20) NULL,
   PRIMARY KEY (IDslot)
);

CREATE TABLE customers
(
   IDcusto             INT NOT NULL,
   Name                VARCHAR(255),
   FirstName           VARCHAR(255),
   Title               VARCHAR(20) NULL,
   Occupation          VARCHAR(255),
   RegistrationDate    DATE NULL,
   IDhousehold         INT NULL,
   PRIMARY KEY(IDcusto)
);






COMMIT;
